import React from "react";
import {BrowserRouter as Router,Route,Routes} from 'react-router-dom';


import GenerateSch from '../GenerateSchedulePage/GenerateSchedulePage';
const Button = () => {
    return (
        <button>START
            <Router>
                <Routes>
                    <Route path="/GenerateSchedule" element = {<GenerateSch />} />
                </Routes>
            </Router>  
        </button>
    );
};

export default Button;
